export function add16(a: number, b: number): number {
  return a + b;
}

export function subtract16(a: number, b: number): number {
  return a - b;
}

export function multiply16(a: number, b: number): number {
  return a * b;
}

export function divide16(a: number, b: number): number {
  return a / b;
}
